import React from 'react';


const Weather = () =>{
    return (
        <div className="container">
            <div className="cards">
            <h1>London</h1>
            <h5 className="py-4">
                <i className="wi wi-day-sunny display-1"></i>
            </h5>
            </div>
        </div>
    );
};

export default Weather;
